import React, { Component } from 'react';
import AccountBalance from './AccountBalance';
import {Link} from 'react-router-dom';

class Home extends Component {
  render() {
    return (
        <div>
          <img src="https://www.incimages.com/uploaded_files/image/970x450/getty_158673029_9707279704500119_78594.jpg" alt="bank"/>
          <h1>Bank of React</h1>

          <Link to="/userProfile">User Profile</Link>

          <AccountBalance accountBalance={this.props.accountBalance} creditInfo={this.props.creditInfo} debitInfo={this.props.debitInfo}/>
        </div>
    );
  }
}

export default Home;
